import React from "react";
import PropTypes from "prop-types";
import { Field, Form } from "formik";

const SearchForm = props => {
  return (
    <Form>
      <Field name="searchString" />
    </Form>
  );
};

SearchForm.propTypes = {};

export default SearchForm;
